      content: "[head=2]      [color=#efb341][/head][head=2]N[/head][/color][head=2]  [/head]\r\n[head=2]  [color=#efb341][/head][head=3]Central Engineering[/head][/color][head=2]  [/head]\r\n\r\n             [head=2]NT-Core-X Xeno-Atmospherics \n                       Control Manual[/head]\n\n[head=3]Each chamber is equipped with the following atmospherics control components:[/head]\n\n[bold]Input Mixer:[/bold]\nThe input mixer will allow you to determine the percentage mixture from its two input ports, as well as the final output pressure.\n\n[bold]Atmospherics Distribution Filter:[/bold]\nThe atmospherics distribution filter uses the stations atmospherics distribution pipe as an input. The atmospherics team on station will fill this pipe with oxygen and nitrogen.\nthis filter can be used to isolate one of those gases for mixing in the artifact chamber. The gas that is NOT filtered will be input into the Input Mixers SECONDARY port.\n\n[bold]Input Port:[/bold]\nThe input port will input the gas from its connected canister into the input mixer's PRIMARY port.\n\n[bold]Siphon Room Button:[/bold]\nThe siphon room button will toggle between the room being siphoned all the way to vacuum, and the room being filled with the output gases from the Input Mixer.\n\n[bold]Ignition Signaller:[/bold]\nA short range remote signaller connected to the igniter in the chamber\n\n[head=3]Additionally, each chamber is equipped with the following ADVANCED components[/head]\n\n[bold]Input Valve:[/bold]\nLocated underneath the analysis console, this valve is NORMALLY automated by the siphon room button, but for advanced use cases you can manually toggle it.\n\n[bold]Siphon Valve:[/bold]\nLocated underneath the analysis console, this valve is NORMALLY automated by the siphon room button, but for advanced use cases you can manually toggle it.\n\n[bold]Atmospherics Air Alarm:[/bold]\nFor your safety this alarm has been set to bolt the door to the artifact chamber when the atmospheric sensor within detects that the room is unsafe. However, these alarms have been configured to allow scientists to alter the parameters that are considered \"safe\". The alarm can also be unlinked from the door using a multi-tool, which will remove this functionality.\n\n[head=3]Shared Chamber Components:[/head]\n[bold]Waste Filters:[/bold]\nBoth chambers, and the filtered OUT gas from the distribution filters are sent to the filters at the top of the room, where you may reclaim gas by setting the filters. Any gas that is not reclaimed here will be sent into the atmospherics waste pipe system to be reclaimed or disposed of by the atmospherics department.\n\n[head=3]Basic Setup Steps:[/head]\n[bold]1.[/bold] Turn on and configure the 4 waste filters. For the chambers to function correctly these 4 filters are expected to ALWAYS be on - though they do not need to be filtering any gases.\n[bold]2.[/bold] Turn on the Atmospherics Distribution filter, it is not usually necessary to toggle this component OFF, though you may elect to change its settings depending on your testing needs.\n \n[head=3]Example usage scenarios:[/head]\n[bold]Low Pressure:[/bold]\n1. Siphon the room\n\n[bold]High Pressure:[/bold]\n0. Turn off any active filters on the distribution filter (set it to not be filtering, just passing gas through)\n1. Set the input mixer to use 100% gas from its secondary port (atmospherics distribution)\n2. Set the mixers pressure to maximum.\n3. Turn on the mixer, the chamber should fill with high pressure atmosphere\n4. After the artifact activates, press the siphon room button.\n5. wait for the room to empty, then turn the mixer down to 101kPA (normal atmospheric pressure), and press the siphon button again to refill the room with normal atmosphere.\n\n[bold]High Temperature or EXTREME pressure:[/bold]\n[italic]This setup can reach temperatures of 70000 degrees and pressures in the millions of kpa[/italic]\n1. Place a canister of plasma gas on the input port and wrench it in place\n2. Set the atmospherics distribution filter to filter OUT nitrogen\n3. Turn off the distribution filter\n3. Turn on the input mixer with 100% usage from its secondary port (to purge nitrogen)\n4. Manually toggle either the Siphon Valve or the Input valve so that BOTH are open.\n5. Wait for the system to purge.\n6. Manually close the Siphon Valve\n7. Set the input mixer to use 3% gas from its primary port, and 97% gas from its secondary port. Set the pressure to 1200\n8. Turn the distribution filter back on (this should immediately begin filling the room with a potent burn mixture.\n9. Hit the ignition switch continually until the room is VERY on fire.\n10. Once the artifact activates turn off the input mixer\n11. Manually toggle the siphon room valve open until the system is purged.\n12. While you wait for the system to purge, reset the filters on the atmospherics distribution filter.\n13. Once the system is purged, close the siphon valve, and set the input mixer to use 100% from the secondary port at 101kPA\n14. turn the input mixer back on and wait for the room to refill with safe atmosphere.\n\n[head=3]If you need help or system reconfiguration please ask the atmospherics department for assistance[/head]\n[italic]Seriously. No one likes teaching people about how cool their job is more than the atmospherics department[/italic]\n\nCentral Command Engineering\n"
